import React from 'react';
var axios = require('axios');

var query = 'https://api.anchorage-development.com/v2/vaults/8fd09f37392e0faa77ab858af3ee350c/wallets';
var apiKey = 'faf601815e5f1c347b1ca98f4046965a9bff0302e311f2b048c2c98ffacd7947';

export default class App extends React.Component{
  constructor(props){
    super(props);
    this.state = {
      loading: true,
      wallets: null
    };
  };

  async componentDidMount(){
    const response = await axios.get(query, {
      headers: {
        'Api-Access-Key': apiKey
      }
    })
    var data = response.data.data;
    this.setState({wallets: data, loading: false});
  };

  WalletList(){
    const wallets = this.state.wallets.map((wallet) => {
      console.log(wallet.walletName)
    });
  }

  render(){
    return(
      <div>
        {
          this.state.loading ?
          ( <div>loading</div> ) :
          ( <WalletList /> )
        }
      </div>
    )
  }
}
